INSERT INTO `emailtemplate` VALUES ('ASSIGN_PROJECT_TO_TEAM','[{{metaprojectTitle}}] Projekte wurden an Teams zugewiesen','Der Metaprojektleiter {{metaprojectLeader}} hat die Zuweisung der\nProjekte vorgenommen. Diese kann jetzt\neingesehen werden.\nWeitere Infos zu den einzelnen Projekten erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/project '),('METAPROJECT_ADD_MEMBER','[{{metaprojectTitle}}] Sie wurden einem Metaprojekt hinzugefügt','Sie wurden durch den Metaprojektleiter {{metaprojectLeader}} dem Metaprojekt {{metaprojectTitle}} hinzugefügt.'),('METAPROJECT_DELETE','[{{metaprojectTitle}}] Das Metaprojekt wurde gelöscht','Das Metaprojekt {{metaprojectTitle}} wurde durch {{sendingUser}} gelöscht.'),('METAPROJECT_LEADER_ADD_TEAM_MEMBER','[{{metaprojectTitle}} - {{teamName}}] Sie wurden einem Team hinzugefügt','Sie wurden durch den Metaprojektleiter {{metaprojectLeader}} dem Team {{teamName}} innerhalb des Metaprojektes {{metaprojectTitle}} hinzugefügt.\r\nWeitere Infos zu diesem Teamerhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}'),('METAPROJECT_LEADER_APPOINTMENT','[{{metaprojectTitle}}] Sie sind Metaprojektleiter','Sie wurden von {{sendingUser}} zum Leiter des\nMetaprojektes \"{{metaprojectTitle}}\" ernannt.\nWeitere Infos zu diesem Metaprojekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}.\n'),('METAPROJECT_LEADER_CHANGE_COMMON','[{{metaprojectTitle}}] Metaprojektleiterwechsel','{{oldLeader}} wurde als Leiter des Metaprojektes \"{{metaprojectTitle}}\" durch {{newLeader}} abgelöst. \nWeitere Infos zu diesem Metaprojekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}.'),('METAPROJECT_LEADER_CHANGE_NEW','[{{metaprojectTitle}}] Sie sind neuer Metaprojektleiter','Sie wurden von {{sendingUser}} zum Nachfolger von {{oldLeader}} als neuer Leiter des\nMetaprojektes \"{{metaprojectTitle}}\" ernannt.\nWeitere Infos zu diesem Metaprojekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}.\n'),('METAPROJECT_LEADER_CHANGE_OLD','[{{metaprojectTitle}}] Aberkennung Metaprojektleiter','Sie wurden von {{sendingUser}} als Leiter des Metaprojektes \"{{metaprojectTitle}}\" entfernt.\nWeitere Infos zu diesem Metaprojekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}.\n'),('PROJECT_DELETE_COMMON','[{{metaprojectTitle}} - {{projectTitle}}] Projekt wurde gelöscht','Das Projekt {{projectTitle}} innerhalb des Metaprojektes {{metaprojectTitle}} wurde durch {{sendingUser}} gelöscht.'),('PROJECT_DELETE_SPECIFIC','[{{metaprojectTitle}} - {{projectTitle}}] Projekt wurde gelöscht','Das Projekt {{projectTitle}} das Ihnen innerhalb des\r\nMetaprojektes {{metaprojectTitle}} zugeordnet wurde, ist durch {{sendingUser}} entfernt worden.'),('PROJECT_LEADER_APPOINTMENT','[{{metaprojectTitle}} - {{projectTitle}}] Sie sind Projektleiter','Sie wurden von {{sendingUser}} zum Leiter des\r\nProjekts \"{{projectTitle}}\" innerhalb des Metaprojekts \"{{metaprojectTitle}}\" ernannt.\r\nWeitere Infos zu diesem Projekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/project/{{projectId}}.\r\n'),('PROJECT_LEADER_CHANGE_COMMON','[{{metaprojectTitle}} - {{projectTitle}}] Projektleiterwechsel','Im Projekt \"{{projectTitle}}\" innerhalb des Metprojektes \"{{metaprojectTitle}}\" ist {{oldLeader}} durch {{newLeader}} als Projektleiter ersetzt worden.\r\nWeitere Infos zu diesem Projekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/project/{{projectId}}.'),('PROJECT_LEADER_CHANGE_NEW','[{{metaprojectTitle}} - {{projectTitle}}] Sie sind neuer Projektleiter','Sie wurden von {{sendingUser}} zum Nachfolger von {{oldLeader}} als\r\nneuen Leiter des Projektes {{projectTitle}} innerhalb des\r\nMetaprojektes {{metaprojectTitle}} ernannt.\r\nWeitere Infos zu diesem Projekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/project/{{projectId}}.'),('PROJECT_LEADER_CHANGE_OLD','[{{metaprojectTitle}} - {{projectTitle}}] Aberkennung Projektleiter','Sie wurden durch {{sendingUser}} als Leiter des Projektes {{projectTitle}} innerhalb des Metaprojektes {{metaprojectTitle}} entfernt.\r\nWeitere Infos zu diesem Projekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/project/{{projectId}}.\r\n'),('TEAM_APPLICATION_ACCEPT','[{{metaprojectTitle}} - {{teamName}}] Bewerbung wurde akzeptiert','Das Team {{teamName}} innerhalb des Metaprojekts {{metaprojectTitle}} hat Sie aufgenommen.'),('TEAM_APPLICATION_REJECT','[{{metaprojectTitle}} - {{teamName}}] Bewerbung wurde abgelehnt','Das Team {{teamName}} innerhalb des Metaprojekts {{metaprojectTitle}} hat Ihre Bewerbung abgelehnt.'),('TEAM_APPLICATION_WITHDRAW','[{{metaprojectTitle}} - {{teamName}}] Bewerbung wurde zurückgezogen','{{sendingUser}} hat die Bewerbung für ihr Team {{teamName}} innerhalb des Metaprojektes {{metaprojectTitle}} zurückgezogen.'),('TEAM_DELETE_COMMON','[{{metaprojectTitle}} - {{teamName}}] Team wurde gelöscht','Das Team {{teamName}} innerhalb des Metaprojektes {{metaprojectTitle}} wurde durch {{sendingUser}} gelöscht.'),('TEAM_DELETE_SPECIFIC','[{{metaprojectTitle}} - {{teamName}}] Team wurde gelöscht','Das Team {{teamName}} das Ihnen innerhalb des\r\nMetaprojektes {{metaprojectTitle}} zugeordnet wurde, ist von {{sendingUser}}\r\ngelöscht worden.'),('TEAM_INVITATION_ACCEPT','[{{metaprojectTitle}} - {{teamName}}] Einladung wurde angenommen','{{sendingUser}} hat die Einladung für das Team {{teamName}} innerhalb des Metaprojekts {{metaprojectTitle}} angenommen.\r\n'),('TEAM_INVITATION_REJECT','[{{metaprojectTitle}} - {{teamName}}] Einladung wurde abgelehnt','{{sendingUser}} hat die Einladung für das Team {{teamName}} innerhalb des Metaprojekts {{metaprojectTitle}} abgelehnt.'),('TEAM_INVITATION_WITHDRAW','[{{metaprojectTitle}} - {{teamName}}] Einladung wurde zurückgezogen','{{sendingUser}} hat die Einladung für das Team {{teamName}} innerhalb des Metaprojektes {{metaprojectTitle}} zurückgezogen.'),('TEAM_INVITE','[{{metaprojectTitle}}] Team Einladung','Sie wurden vom Team \"{{teamName}}\" im Metaprojekt \"{{metaprojectTitle}}\" eingeladen. Sie können innerhalb eines Metaprojektes nur\neinem Team angehören. Alle weiteren Einladungen werden entfernt. Möchten Sie beitreten?\nSie können die Anfrage beantworten unter: {{systemBaseUrl}}#/communication.\nWeitere Infos zu diesem Team erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}.\n'),('TEAM_LEADER_APPOINTMENT','[{{metaprojectTitle}} - {{teamName}}] Sie sind Teamleiter','Sie wurden von {{sendingUser}} zum Leiter des Teams \"{{teamName}}\"\ninnerhalb des Metaprojektes \"{{metaprojectTitle}}\" ernannt.\nWeitere Infos zu diesem Team erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}.'),('TEAM_LEADER_CHANGE_COMMON','[{{metaprojectTitle}} - {{teamName}}] Teamleiterwechsel','{{oldLeader}} wurde als Leiter des Teams\"{{teamName}}\" innerhalb des Metaprojekts \"{{metaprojektTitle}}\" durch {{newLeader}} abgelöst. \r\nWeitere Infos zu diesem Team erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}.'),('TEAM_LEADER_CHANGE_NEW','[{{metaprojectTitle}} - {{teamName}}] Sie sind neuer Teamleiter','Sie wurden von {{sendingUser}} zum Nachfolger von {{oldLeader}} als neuer Leiter des\nTeams \"{{teamName}}\" innerhalb des Metaprojekts \"{{metaprojectTitle}}\" ernannt.\nWeitere Infos zu diesem Metaprojekt erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}.\n'),('TEAM_LEADER_CHANGE_OLD','[{{metaprojectTitle}} - {{teamName}}] Aberkennung Teamleiter','Sie wurden von {{sendingUser}} als Leiter des Teams \"{{teamName}}\" innerhalb des  Metaprojektes \"{{metaprojectTitle}}\" entfernt.\r\nWeitere Infos zu diesem Team erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}.\r\n'),('TEAM_REMOVE_MEMBER_COMMON','[{{metaprojectTitle}} - {{teamName}}] Teammitglied wurde entfernt','Das Teammitglied {{teamMember}} wurde aus dem Team {{teamName}} innerhalb des Metaprojektes {{metaprojectTitle}} entfernt.'),('TEAM_REMOVE_MEMBER_LEADER','[{{metaprojectTitle}} - {{teamName}}] Teammitglied wurde entfernt','{{teamMember}} wurde aus dem Team {{teamName}} innerhalb des Metaprojektes {{metaprojectTitle}} entfernt. Dieses Team ist Ihrem\r\nProjekt zugeordnet.\r\nWeitere Infos zu diesem Team erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}'),('TEAM_REMOVE_MEMBER_SPECIFIC','[{{metaprojectTitle}} - {{teamName}}] Sie wurden aus dem Team entfernt','Sie wurden durch {{sendingUser}} aus dem Team {{teamName}} innerhalb\r\ndes Metaprojektes {{metaprojectTitle}} entfernt.'),('TEAM_REQUEST','[{{metaprojectTitle}}] Team Anfrage','{{sendingUser}} hat sich für Ihr Team \"{{teamName}}\" im Metaprojekt \"{{metaprojectTitle}}\"\r\nbeworben. Möchten Sie ihn in Ihrem Team aufnehmen?\r\nSie können die Anfrage beantworten unter: {{systemBaseUrl}}#/communication.\r\nWeitere Infos zu Ihrem Team erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}.\r\n'),('TEAM_SEND_PRIO','[{{metaprojectTitle}} - {{teamName}}] Finale Priorisierung des Teams','Das Team {{teamName}} hat die finale Priorisierung des\r\nMetaprojekts {{metaprojectTitle}} abgegeben.\r\nWeitere Infos zu diesem Team erhalten Sie unter diesem Link: {{systemBaseUrl}}#/metaproject/{{metaprojectId}}/teams/{{teamId}}.');
