taprojektregistrierung Ende\" in diesem Projekt.</p><p>Gehen Sie dazu wie folgt vor:</p><ol><li>Melden Sie sich mit Ihrem HTWG-Account unter Login (oben rechts) an</li><li>Wählen Sie in der Übersicht der existierenden Metaprojekte dieses Metaprojekt aus.</li><li>Klicken Sie dann ganz unten auf der Seite auf \"Einzelregistrierung\".</li></ol><p><br></p><p>Bis zur oben genannten Frist \"Projekterstellungszeitraum Ende\" haben alle Professorinnen und Professoren, die ein Teamprojekt anbieten, ein zugehöriges Projekt in diesem Metaprojekt erstellt.</p><p><br></p><p><br></p><p>VORGEHENSWEISE FÜR KOLLEGEN, DIE EIN TEAMPROJEKT ANBIETEN WOLLEN:</p><p><br></p><p>Im Zeitraum der Projektregistrierung bis zur oben genannten Frist \"Projekterstellungszeitraum&nbsp;Ende\" können Sie Projekte erstellen.</p><p>a.&nbsp;Wählen Sie dazu nach der Anmeldung in Metaproject das Metaprojekt \"Teamprojekt MSI\" für das jeweilige Semester aus. Klicken Sie ganz unten auf der Seite auf den Button \"Projekte\".</p><p>b. Klicken Sie auf der Seite \"Projekte\" den Button \"Neues Projekt\".</p><p>c.&nbsp;Auf dieser Seite gibt es Reihe von Pflichtfeldern, die mit einem \"*\" gekennzeichnet sind. Sie können das Projekt über den Richtext-Editor auf dieser Seite beschreiben oder auch eine Beschreibung als PDF hochladen.&nbsp;Sie können auch mehrere für die Beschreibung relevante Dokumente hochladen. Klicken Sie am Ende den Button \"Erstellen\" unten auf der Seite.</p><p><br></p><p>Die Projektleiter können durch Checkboxen entscheiden, ob sie den Titel, den Projektleiter&nbsp;oder die Beschreibung öffentlich haben wollen. Per Voreinstellung sind diese Daten öffentlich. Man kann diese „öffentliche“ Information auch über ein iframe-Tag in bestehende Web-Seiten&nbsp;einbetten. Die Information kann Ihnen unser Kollege Rainer Mueller dazu liefern.</p>','Test Simon','2021-05-31T17:34:44.000Z','2021-05-24T17:34:31.000Z',5,'2020-12-25T09:26:10.000Z','2020-12-23T09:26:10.000Z',25,1,'3114-09-30T22:39:07.791Z','2