orkload von 240h pro Teammitglied.</li><li>Die Themen werden von den Professoren ausgeschrieben und ändern sich in der Regel von Semester zu Semester. Jedes Team bearbeitet ein Thema und wird dabei von dem Professor betreut, der das Thema ausgeschrieben hat.</li></ul><p><br></p><h3>Einzelregistrierung</h3><p>Wenn Sie an der Lehrveranstaltung „Teamprojekt“ im kommenden Semester teilnehmen wollen, dann registrieren Sie sich bis der oben genannten Frist \"Metaprojektregistrierung Ende\" in diesem Projekt.</p><p>Gehen Sie dazu wie folgt vor:</p><ol><li>Melden Sie sich mit Ihrem HTWG-Account unter Login (oben rechts) an</li><li>Wählen Sie in der Übersicht der existierenden Metaprojekte dieses Metaprojekt aus.</li><li>Klicken Sie dann ganz unten auf der Seite auf \"Einzelregistrierung\".</li></ol><p><br></p><p>Bis zur oben genannten Frist \"Projekterstellungszeitraum Ende\" haben alle Professorinnen und Professoren, die ein Teamprojekt anbieten, ein zugehöriges Projekt in diesem Metaprojekt erstellt.</p><p><br></p><p><br></p><p>VORGEHENSWEISE FÜR KOLLEGEN, DIE EIN TEAMPROJEKT ANBIETEN WOLLEN:</p><p><br></p><p>Im Zeitraum der Projektregistrierung bis zur oben genannten Frist \"Projekterstellungszeitraum&nbsp;Ende\" können Sie Projekte erstellen.</p><p>a.&nbsp;Wählen Sie dazu nach der Anmeldung in Metaproject das Metaprojekt \"Teamprojekt MSI\" für das jeweilige Semester aus. Klicken Sie ganz unten auf der Seite auf den Button \"Projekte\".</p><p>b. Klicken Sie auf der Seite \"Projekte\" den Button \"Neues Projekt\".</p><p>c.&nbsp;Auf dieser Seite gibt es Reihe von Pflichtfeldern, die mit einem \"*\" gekennzeichnet sind. Sie können das Projekt über den Richtext-Editor auf dieser Seite beschreiben oder auch eine Beschreibung als PDF hochladen.&nbsp;Sie können auch mehrere für die Beschreibung relevante Dokumente hochladen. Klicken Sie am Ende den Button \"Erstellen\" unten auf der Seite.</p><p><br></p><p>Die Projektleiter können durch Checkboxen entscheiden, ob sie den Titel, den Projektleiter&nbsp;oder die Beschreibung öffentlich haben wollen. Per Voreinstellung sind diese Daten öffentlich. Man kann diese „öffentliche“ Information auch über ein iframe-Tag in bestehende Web-Seiten&nbsp;einbetten. Die Information kann Ihnen unser Kollege Rainer Mueller dazu liefern.</p>','Testprojekt1','\0',48456,43083,'\0',10,1,'','','Aktiv','Admin Test','28.06.2021 09:59',0,0,''),(48726,'2021-07-05T13:02:18.000Z','','','Meta351','\0',48718,10,'\0',2,1,'','','Abgebrochen','','',0,0,''),(48738,'2021-06-30T11:28:58.000Z','','','P1','\0',48699,48209,'\0',5,2,'','','Aktiv','','',0,0,''),(48755,'2021-07-04T09:04:28.000Z','','','Projektausgeschrieben','\0',48747,5,'\0',25,1,'','','Ausgeschrieben','','',0,0,''),(48758,'2021-07-04T09:05:44.000Z','','','Projekt Aktiv','\0',48747,5,'\0',25,1,'','','Aktiv','','',0,0,''),(48761,'2021-07-04T09:06:10.000Z','','','Projekt Abgebrochen','\0',48747,5,'\0',25,1,'','','Abgebrochen','','',0,0,''),(48764,'2021-07-04T09:06:50.000Z','','','Projekt Abgeschlossen','\0',48747,5,'\0',25,1,'','','Abgeschlossen','','',0,0,''),(48994,'2021-06-30T11:18:56.000Z','','','test','\0',48747,5,'\0',25,1,'','','Ausgeschrieben','','',0,0,''),(48997,'2021-06-30T11:21:55.000Z','Discord','','test2','\0',48747,5,'\0',25,1,'','2021-06-30T11:22:01.000Z','Ausgeschrieben','','',0,0,''),(49051,'2021-07-01T08:00:40.000Z','','<h3>Allgemeines zum Teamprojekt&nbsp;</h3><ul><li>Das Teamprojekt in den Masterstudiengängen der Fakultät IN hat eine Laufzeit von zwei Semestern. Es beginnt und endet in der Regel mit der Vorlesungszeit. Der Endzeitpunkt ist dabei nicht zwingend.</li><li>Die Teams bestehen aus 3-7 Studierenden. Die Teambildung erfolgt durch die Studierenden selbst.</li><li>Das Teamprojekt hat gemäß Modulhandbuch einen Workload von 240h pro Teammitglied.</li><li>Die Themen werden von den Professoren ausgeschrieben und ändern sich in der Regel von Semester zu Semester. Jedes Team bearbeitet ein Thema und wird dabei von dem Professor betreut, der das